import "./App.css";
import NavBar from ".Components/NavigationBar/Navbar";
import ContentBox from "./Components/ContentBox/ContentBox";
function App() {
  return (
    <div className="App">
      <NavBar />
      <ContentBox />
    </div>
  );
}

export default App;
